describe("CapSettingEnum", function() {
	"use strict";

	var CapSettingEnum;

	beforeEach(function() {
		module("dx.webui.question");
		inject(function($injector) {
			CapSettingEnum = $injector.get("CapSettingEnum");
		});
	});

	it("is frozen", function() {
		expect(Object.isFrozen(CapSettingEnum)).toBeTruthy()
	});

	it("has the correct parts", function() {
		expect(CapSettingEnum.NONE).toEqual(0);
		expect(CapSettingEnum.SOFT).toEqual(1);
		expect(CapSettingEnum.HARD).toEqual(2);
	});
});
